import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a product card to be available
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Click the first product card to open the modal
    await page.locator('.product-card').first().click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_click.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_click.png'));

    // Wait for the modal to become visible
    const modalLocator = page.locator('#productModal');
    await modalLocator.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot of the open modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_visible.png'));

    // Extract the title from the modal
    const modalTitle = await page.locator('.product-detail-title').textContent();

    return {
      success: true,
      action: "Opened the product detail modal by clicking the first product card.",
      extractedData: {
        modalTitle: modalTitle.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, take a final screenshot for debugging
    try {
      const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
      await page.screenshot({ path: errorScreenshotPath });
      screenshots.push(errorScreenshotPath);
    } catch (e) {
      // Ignore if screenshot fails
    }

    return {
      success: false,
      action: "Failed to open product detail modal",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
